VALUES ('3596690001030', 'Croque junior', 'Pré aration à base de viande de poulet traitée en salaison : viande de poulet 59,3% soit 29,6% sur la recette), eau, semoule de blé, protéines de blé, amidon modifié, dextrose, sel, stabilisants : E451, E452, E450, arômes (céleri), Fromage fondu : fromages eau, beurre protéine de lait amidons modifiés, lactosérum (lgiL), sel de fonte : E331, arôme, sel, gélifiant : E407. Enrobage : farine de blé, eau, amidon et protéines de blé sel, levure, épices, conservateur : E202. Huile de tournesol. Traces éventuelles d\'œuf. Produit en France à partir de viande rigoureusement sélectionnée d\'origine : UE. Malgré le soin tout particulier apporté par Père Dodu à la fabrication de ce produit, il est possible qu\'il contienne encore des petits morceaux d\'os.', 'https://static.openfoodfacts.org/images/products/359/669/000/1030/front_fr.4.400.jpg', '13', '4', '19', '4', '', '10', '1.6', '0.62992125984252', '', '0');

